css:
@-moz-document domain("streamlabs.com") {
.docklet {
    color: #999;
}
element.style {
    color: white;
}
.docklet strong {
    color: #d3d3d3;
}
.docklet .heading {
    background: rgb(50, 50, 50);
    border-bottom: 1px solid rgba(0, 0, 0, 0.65);
    color: #D3D3D3;
}
.checkbox .checkbox-inner+span {
    color: white;
}
.recent-events-list > div {
    background: none repeat scroll 0 0 rgb(30, 30, 30);
}
.recent-events-list > div.even {
    background: none repeat scroll 0 0 #282828;
}
.selectable {
    color: #D3D3D3;
}
#scrollit {
    background: rgb(30, 30, 30);
}
.alert-controls {
    background: rgb(50, 50, 50)!important;
}
.fa.fa-quote-left {
    color: #3c3c3c!important;
}
.fa.fa-quote-right {
    color: #3c3c3c!important;
}
.checkbox .checkbox-inner+span {
    color: #999!Important;
}
.div {
    color: #D3D3D3!important;
}
.iScrollIndicator {
    background: white!important;
}
}
